import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Header from './components/Header.js'
import merch from './pages/merch.js';

function App () {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path='/merch' element={<merch />} />

          </Routes>

    </BrowserRouter>

  )
}

export default App
